LE MANS4は多くのユーザーがタイヤに求める「快適」「環境」「安全」「経済性」の4つの性能を高次元でバランスさせた、低燃費タイヤです。ダンロップの独自技術である特殊吸音スポンジやノイズ防止ストレートブロックの採用で、騒音エネルギーを13%（LE MANS LM703比）低減し、上質な静粛性を実現しました。<br><br>また新開発の「低発熱密着ゴム」により3.8%（LE MANS LM703比）の燃費向上とともにウエットブレーキ性能を9%（LE MANS LM703比）向上、低燃費性能とブレーキ性能を高い次元で両立。さらに接地圧分布を適正化した新パターンの採用でライフ性能を17%（LE MANS LM703比）向上しました。<br><br>※販売価格はタイヤ1本の価格です。ホイールは装着イメージです。<br><br>タイヤサイズ：245/40R20 (245/40-20)<br><br><br><br>サマータイヤ | 夏タイヤ/20インチ<tr><td colspan="2">
